import { Component } from "react";
class CardList extends Component
{
    render()
    {
        console.log(this.props);
        const {monster} = this.props;
        return (
            <div>
            {
              monster.map((monster)=>{
              return (
                <div key={monster.id}>
                  
                  <h2>
                    {monster.name}
                  </h2>
                </div>
              );
            }
              )
            }
        </div>
        );
    };
}
export default CardList;
